
$(".enter").click(function() {
var one = $(".scale").val();
var Q2 = $(".hv").val();
console.log(one, Q2);
if (one >= 7 && Q2 === "hero"){
    $(".h1").text("You are Tracer");
    $(".answer").text("Tracer is very fast and can blink through time, she is also very hyper");
    $(".image").append("<img class=Tracer' src='data:image/jpeg;base64,'>");
} else if (one <= 3 && Q2 === "hero"){
    $(".h1").text("You are Zenyatta");
    $(".answer").text("Zen is a machine of peace");
    $(".image").append("<img class=zen' src='data:image/jpeg;base64,'>");
} else if (one <= 6 && Q2 === "hero"){
    $(".h1").text("You are Winston");
    $(".answer").text("Winston is a super smart monkey who is able to create a lot of things. He also can get super angry at certain times, but usally stays calm");
    $(".image").append("<img class=Winston' src='https://dotesports-media.nyc3.cdn.digitaloceanspaces.com/wp-content/uploads/2018/08/11155921/2429c44e-c1c0-4519-a7f3-344947330a2a.jpg'>");
} else if (one >= 1 && Q2 === "villian"){
    $(".h1").text("You are Widowmaker");
    $(".answer").text("WIdow is a female sniper that works for talon");
    $(".image").append("<img class=Widowmaker' src='data:image/jpeg;base64,'>");
} else {
    $(".h1").text("None, Try again");
}

});